import React from 'react';

import './roomList.css';

function RoomList() {
    return (
        <div id='room-list'>
            <div id='room-list-content'>
                <h1>Stardust Owners Suites</h1>
                <hr className='top' />
                <hr className='bottom' />
            </div>
        </div>
    )
}

export default RoomList;
